import React from "react";
import "./App.css";
import "./assets/css/bootstrap.min.css";
import "./assets/css/StyleSheet1.css";
// import Header from "./header.js";
import VillageReportCard from "./villageReportCard";
import VillageDetails from "./villageDetails";
import OdfPlus from "./odfPlus";
import VillageBasicInfromation from "./villageBasicInformation";
import InstitutionalToilets from "./institutionalToilets";
import VisualCleanliness from "./visualCleanliness";
import OdfPlusCertificate from "./odfPlusCertificate";
import SwachhagrahiDetail from "./swachhagrahiDetail";
import CommunityAssets from "./communityAssets";

function App() {
  return (
    <div className="App">
      {/* <Header /> */}
      <div className="container">
        <VillageReportCard />
        <VillageDetails />
        <div className="row">
          <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
            <OdfPlus />
          </div>
          <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
            <VillageBasicInfromation />
            <InstitutionalToilets />
            <VisualCleanliness />
            <OdfPlusCertificate />
            <SwachhagrahiDetail />
          </div>
        </div>
        <CommunityAssets />
      </div>
    </div>
  );
}

export default App;
